import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <Layout style={{ minHeight: "100vh" }}>
        <Header style={{ height: 80 }}>
          <Navbar />
        </Header>
        <Content>
          <Routes>
            <Route path="/prova-web" element={<HomePage />} />
            {/* <Route path="/clubs/:clubId" element={<ClubPage />} /> */}
          </Routes>
        </Content>
      </Layout>
    </div>
  );
}

export default App;
